import React, { Component } from 'react'
import { Text, StyleSheet, View } from 'react-native'

export function Heading({ children, style, ...props }) {

    return (
        <Text
            {...props}
            style={[styles.text, style]}
        > {children}
        </Text>
    )
    
}
const styles = StyleSheet.create({
    text: {
        fontSize: 32,
        color: 'black',
    }
})
